import "fmt"

func largestIsland(grid [][]int) int {
	island, res, index := make(map[int]int), 0, 2
	for i := 0; i < len(grid); i++ {
		for j := 0; j < len(grid[i]); j++ {
			if grid[i][j] == 1 {
				count := dfs827(i, j, index, grid)
				island[index] = count
				index++
			}
		}
	}
	if island[2] == 0 {
		return 1
	}

	for i := 0; i < len(grid); i++ {
		for j := 0; j < len(grid[i]); j++ {
			if grid[i][j] == 0 {
				count := getIslands(i, j, grid, island)
				res = max827(res, count)
			}
		}
	}
	if res == 0 {
		return island[2]
	}
	return res
}

func getIslands(row, col int, grid [][]int, island map[int]int) int {
	used := make(map[int]int)
	dir, count := []int{-1, 0, 1, 0, -1}, 0
	for k := 0; k < 4; k++ {
		i, j := row + dir[k], col + dir[k + 1]
		if i < 0 || j < 0 || i >= len(grid) || j >= len(grid[0]) || grid[i][j] == 0 {
			continue
		}
		index := grid[i][j]
		if _, ok := used[index]; !ok {
			count += island[index]
		}
		used[index]++
	}
	return count + 1
}

func dfs827(row, col, index int, grid [][]int) int {
	if row < 0 || col < 0 || row >= len(grid) || col >= len(grid[0]) || grid[row][col] == 0 || grid[row][col] > 1 {
		return 0
	}
	grid[row][col] = index
	dir, count := []int{-1, 0, 1, 0, -1}, 1
	for k := 0; k < 4; k++ {
		count += dfs827(row + dir[k], col + dir[k + 1], index, grid)
	}
	return count
}

func max827(a, b int) int {
	if a > b {
		return a
	}
	return b
}

